css:
.print-format {
    font-size: 10px;
    background: white;
    pading:0.33in!important;

}

.print-heading {
    border-bottom: 1px solid #f4f5f6;
    padding-bottom: 5px;
    margin-bottom: 10px;
}


h2 {
    font-size: 16px;
    text-align:center!important;
    margin:0px!important;
    padding:0px!important;
    text-transform: uppercase!important;
}

hr{
    margin-top: 5px;
    margin-bottom: 5px;
    border: 0;
    border-top: 1px solid #000000;
}

.print-heading h2 {
    font-size: 18px;
    text-align:center
}

.print-heading h2 div {
    font-weight: 600;
}

.print-heading small {
    font-size: 13px !important;
    font-weight: normal;
    line-height: 2.5;
    color: #4c5a67;
}

.print-format .letter-head {
    margin-bottom: 5px;
}

.print-format .letter-head h1 {
    margin: 0px!important;
}

.print-format label {
    font-weight: normal;
    font-size: 13px;
    color: #4C5A67;
    margin-bottom: 0;
}

.print-format .data-field {
    margin-top: 0;
    margin-bottom: 0;
}

.print-format .value {
    color: #192734;
    line-height: 1.8;
}

.print-format .section-break:not(:last-child) {
    margin-bottom: 0;
}

.print-format .row:not(.section-break) {
    line-height: 1.6;
    margin-top: 15px !important;
}

.print-format .important .value {
    font-size: 13px;
    font-weight: 600;
}
.print-format thead {
    border-bottom:solid 1px #000!important;
}
.print-format th {
    color: #000!important;
    font-weight: normal;
    border:0px  !important;
    background:#a2a2a2!important;

}

.print-format .table-bordered td {
    border: 0px!important;
    border-bottom: solid 1px #efefef!important

}

.print-format .table-bordered {
    border: 0!important;
    margin-top:-5px!important;
}

.print-format td, .print-format th {
    padding:5px 5px !important;
    vertical-align:middle!important;
}

.print-format .primary.compact-item {
    font-weight: normal;
}

.print-format table td .value {
    font-size: 12px;
    line-height: 1.8;
}
